package oct;

// https://leetcode.com/problems/best-time-to-buy-and-sell-stock-iii/
public class Solution1016 {
    public int maxProfit(int[] prices) {
        // [3,3,5,0,0,3,1,4]
        //              ^ ^ => maxProfit
        //  ^         ^     => maxProfit

        // dp[i][j] => [i ~ j] 까지의 최대 profit
        // https://leetcode.com/problems/best-time-to-buy-and-sell-stock-iii/discuss/39611/Is-it-Best-Solution-with-O(n)-O(1).
        int buyLeft = Integer.MIN_VALUE;
        int buyRight = Integer.MIN_VALUE;
        int sellLeft = 0;
        int sellRight = 0;

        for (int price : prices) {
            sellRight = Math.max(sellRight, buyRight + price); //오른쪽에서 비싸게 팔기
            buyRight = Math.max(buyRight, sellLeft - price); // 왼쪽에서 비싸게 판 시점에 사기
            sellLeft = Math.max(sellLeft, buyLeft + price);  // 비싸게 팔기
            buyLeft = Math.max(buyLeft, -price);    // 싸게 사기
        }

        return sellRight;
    }


    public static void main(String[] args) {
        Solution1016 s = new Solution1016();
        System.out.println(s.maxProfit(new int[]{3,3,5,0,0,3,1,4}));
    }
}

